import LayoutAfterLogIn from "./Layout_After_LogIn_Pacient/Layout_After_LogIn";
import {Route, Routes} from "react-router-dom";
import LayoutBeforeLogIn from "../../beforeLogIn/Layout_Before_LogIn/Layout_Before_LogIn";
import Home from "../../beforeLogIn/Home/Home";
import AllMedics from "../../beforeLogIn/Medics/AllMedics";
import AllServices from "../../beforeLogIn/Services/AllServices";
import OpeningHours from "../../beforeLogIn/OpeningHours/OpeningHours";
import Contact from "../../beforeLogIn/Contact/Contact";

function pacientHome(){
    return(
        <div>
            <Routes>
                <Route
                    path="/"
                    element={
                        <LayoutAfterLogIn>

                        </LayoutAfterLogIn>
                    }
                />
                <Route
                    path="medics/*"
                    element={
                        <LayoutBeforeLogIn>
                            <AllMedics />
                        </LayoutBeforeLogIn>
                    }
                />
                <Route
                    path="services/*"
                    element={
                        <LayoutBeforeLogIn>
                            <AllServices />
                        </LayoutBeforeLogIn>
                    }
                />
                <Route
                    path="opening-hours"
                    element={
                        <LayoutBeforeLogIn>
                            <OpeningHours />
                        </LayoutBeforeLogIn>
                    }
                />
                <Route
                    path="Contact"
                    element={
                        <LayoutBeforeLogIn>
                            <Contact />
                        </LayoutBeforeLogIn>
                    }
                />
            </Routes>
        </div>
    );
}

export default pacientHome();
